import React from 'react';
import { Container, Row, Col, Button, ListGroup } from 'react-bootstrap';
import '../styles/DashboardPaciente.css';

function DashboardPaciente() {
    return (
        <Container fluid className="dashboard-paciente">
            <Row>
                {/* Sidebar */}
                <Col md={3} className="sidebar">
                    <h4>Menu do Paciente</h4>
                    <ListGroup variant="flush">
                        <ListGroup.Item action href="#marcar-consulta">Marcar Consulta</ListGroup.Item>
                        <ListGroup.Item action href="#ver-exames">Ver Exames</ListGroup.Item>
                        <ListGroup.Item action href="#historico-consultas">Histórico de Consultas</ListGroup.Item>
                        <ListGroup.Item action href="#perfil">Perfil</ListGroup.Item>
                    </ListGroup>
                </Col>

                {/* Conteúdo Principal */}
                <Col md={9} className="content">
                    <h2>Bem-vindo à Dashboard do Paciente</h2>
                    <p>Escolha uma opção no menu para começar.</p>
                    {/* Espaço para renderizar componentes selecionados */}
                    <div id="conteudo-dinamico">
                        {/* Conteúdo das seções específicas será renderizado aqui */}
                    </div>
                </Col>
            </Row>
        </Container>
    );
}

export default DashboardPaciente;
